import React from "react";
import classes from "./Meal.module.css";

function Meal(props) {
  return (
    <li className={classes.meal}>
      <span className={classes.header}><></>{props.meal.name}</span>
      {props.meal.description}
      {props.meal.price}
    </li>
  );
}

export default Meal;
